// make code pretty
window.prettyPrint && prettyPrint();

$(function() {
    /* Default tooltip selector */
    $("a[rel=tooltip]").tooltip();
	$(".container table:not(#webpage_content table)").addClass("table table-striped");
	
	$("input[type=submit]").addClass("btn");
	$(".indexRow").addClass("navbar");
	$(".indexRow").each(function(index) {
	});
	$(".indexRow").each(function(index) {
		$(".metaCell", this).detach().appendTo($(".indexData", this));
		$(".metaCell", this).addClass("nav-collapse");
		$(".metaCell", this).addClass("nav-collapse" + index);
		$(this).prepend("<a class=\"btn btn-navbar\" data-toggle=\"collapse\" data-target=\".nav-collapse" + index + "\"><span class=\"icon-bar\"></span><span class=\"icon-bar\"></span><span class=\"icon-bar\"></span></a>");
		$(".actionCell", this).addClass("nav-collapse");
		$(".actionCell", this).addClass("nav-collapse" + index);
	});
	$(".indexRow").wrapInner("<div class=\"container\" />");
	$(".indexRow").wrapInner("<div class=\"navbar-inner\" />");
	
	$(".actionCell ul").addClass("nav");
	$(".titleCell").addClass("brand");
	$(".indexCell").each(function(index) {
		titleCell = $(".actionCell", this).detach();
		titleCell.insertAfter($(".titleCell", this));
	});
	
	$(".imageCell").each(function(index) {
		if (!$("img", this).length) {
			$(this).hide();
		}
	});
	
	/* pagination */
	$(".paging").addClass("pagination");
	$(".paging span:first-child").addClass("previous");
	$(".paging span:last-child").addClass("next");
	$(".paging span").wrapAll("<ul />");
	$(".paging ul span").wrap("<li />");
	
	/* messages */
	$("#flashMessage").addClass("alert alert-info");
    $("#flashMessage").prepend("<button type=\"button\" class=\"close\" data-dismiss=\"alert\">×</button>");
    
    $("body").attr("data-spy", "scroll");
    $("body").attr("data-target", ".bs-docs-sidebar");
});
